import "./App.css";
import "./index.css";

import { AboutUs, HIW, Navbar, Pricing, FAQs } from "./components";
import { Header, Footer } from "./containers";

function App() {
  return (
    <div className="App">
      <Navbar />
      <Header />
      <AboutUs />
      <HIW />
      <Pricing />
      <FAQs />
      <Footer />
    </div>
  );
}

export default App;
